import './foot.css';

const Footer = ({ balance }) => { 
    return ( 
        <footer class="shadow-sm p-3 mb-5 bg-light rounded footer" className='footer'> 
            <div className="container text-center">
                <div className="row">
                    <div className="col socialmedia">
                    <br></br>
                    <br></br>
                        <a href="http://www.facebook.com" target="_blank">
