                        </a>
                        <a href="http://www.linkedin.com" target="_blank">
                            <img src={linkedin} className="linkedin" alt="linkedin" style={{width: "50px"}}/>
                        </a>
                    </div>
                </div>    
                <div className="row text">
                    <div className="col">
                        <p>Â© HSBC Group 2024</p>
                    </div>
                </div>
            </div>
        </footer>
    ); 
}; 

export default Footer;
